import React from "react";
import { Modal, ModalBody, ModalHeader } from "reactstrap";
import IntlMessages from '../../../../../util/IntlMessages';
import MenuItem from '@material-ui/core/MenuItem';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Auxiliary from "../../../../../util/Auxiliary";
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Chip from '@material-ui/core/Chip';
import Avatar from '@material-ui/core/Avatar';
import { connect } from "react-redux";
import { updateEstablishment } from "../../../../../actions/establishmentAction";

const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const mode_payment = [
    {
        value: 'Semestre',
        label: <IntlMessages id="mode_payment.establishment.semester" />,
    },
    {
        value: 'Trimestre',
        label: <IntlMessages id="mode_payment.establishment.trimester" />,
    },
    {
        value: 'Mensuel',
        label: <IntlMessages id="mode_payment.establishment.monthly" />,
    },
    {
        value: 'Annuel',
        label: <IntlMessages id="mode_payment.establishment.annual" />,
    }

];

class EditEstablishment extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            previewVisible: this.props.modal,
            name: '',
            ar_name:'',
            ar_disabled:true,
            address: '',
            code: '',
            city: '',
            countries_id: 0,
            phone: '',
            email_establishment: '',
            website: '',
            surname_director: '',
            name_director: '',
            email_director: '',
            phone_director: '',
            estab_type_id: 0,
            number_students: '',
            contract_start_date: '',
            contract_end_date: '',
            number_sms: '',
            mode_payment: '',
            status: '',
            id: '',
            modules: [],
            photo: '',
            inputText: '',
            logo: '',
            establishmentlogo: null,
            establishmentPhotos: null,
            matricule:'',
            tva:0,
            capital:0,
            siren:0,
            siret:0,
        };
        this.onDrop = this.onDrop.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.handleCancel = this.handleCancel.bind(this);
        this.handleDelete = this.handleDelete.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.handleChangeModule = this.handleChangeModule.bind(this);
        this.getBase64 = this.getBase64.bind(this);
    };

    componentDidMount() {
        const contract_start_date = this.props.establishment.contract_start_date;
        const newStartDate = contract_start_date.split('T');
        const contract_end_date = this.props.establishment.contract_end_date;
        const newEndDate = contract_end_date.split('T');
        if(this.props.establishment.countries_id===1){

            this.setState({
                ar_disabled:false
            })
        }
        this.setState({
            name: this.props.establishment.name,
            ar_name:this.props.establishment.ar_name,
            address: this.props.establishment.address,
            code: this.props.establishment.code,
            city: this.props.establishment.city,
            countries_id: this.props.establishment.countries_id,
            phone: this.props.establishment.phone,
            email_establishment: this.props.establishment.email_establishment,
            website: this.props.establishment.website,
            surname_director: this.props.establishment.surname_director,
            name_director: this.props.establishment.name_director,
            email_director: this.props.establishment.email_director,
            phone_director: this.props.establishment.phone_director,
            estab_type_id: this.props.establishment.estab_type_id,
            number_students: this.props.establishment.number_students,
            contract_start_date: newStartDate[0],
            contract_end_date: newEndDate[0],
            number_sms: this.props.establishment.number_sms,
            mode_payment: this.props.establishment.mode_payment,
            status: this.props.establishment.status,
            id: this.props.establishment.id,
            logo: this.props.establishment.logo,
            modules: Array.from(this.props.establishment.module_id),
            matricule:this.props.establishment.matricule,
            tva:this.props.establishment.tva,
            capital:this.props.establishment.capital,
            siren:this.props.establishment.siren,
            siret:this.props.establishment.siret,
        })
    };

    onDrop = e => {
        let file = e.target.files[0];
        this.setState({
            establishmentPhotos: file,
            inputText: file.name,
        })
    };
    handleDelete() {
        this.props.RequestDeleteEstablishment(this.props.establishment.id)
        this.props.cancelModal()
    };

    handleCancel() {
        this.props.cancelModal()
    };

    handleChangeModule = event => {
        this.setState({ modules: event.target.value });
    };

    handleChange = name => event => {
        if (name === "countries_id") {

          if (event.target.value === 1) {
            this.setState({
              [name]: event.target.value, ar_disabled: false
            })
          }
          else {
            this.setState({
              [name]: event.target.value, ar_disabled: true
            });
          }
        }
        else {
          this.setState({
            [name]: event.target.value,
          });
        }
      };

    handleToggle() {
        this.props.cancelModal();
    };
    getBase64(file, callback) {
        const reader = new FileReader();
        reader.addEventListener('load', () => callback(reader.result));
        reader.readAsDataURL(file);
    }

    handleSubmit = (e) => {
        e.preventDefault();
        const data = {
            name: this.state.name,
            ar_name:this.state.ar_name,
            address: this.state.address,
            code: this.state.code,
            city: this.state.city,
            countries_id: this.state.countries_id,
            phone: this.state.phone,
            email_establishment: this.state.email_establishment,
            website: this.state.website,
            surname_director: this.state.surname_director,
            name_director: this.state.name_director,
            email_director: this.state.email_director,
            phone_director: this.state.phone_director,
            estab_type_id: this.state.estab_type_id,
            number_students: this.state.number_students,
            contract_start_date: this.state.contract_start_date,
            contract_end_date: this.state.contract_end_date,
            number_sms: this.state.number_sms,
            mode_payment: this.state.mode_payment,
            status: this.state.status,
            module_id: this.state.modules,
            id: this.state.id,
            logo: this.state.logo,
            matricule: this.state.matricule,
            tva:parseInt(this.state.tva, 10),
            capital:parseInt(this.state.capital, 10) ,
            siren:parseInt(this.state.siren, 10),
            siret:parseInt(this.state.siret, 10),
        }
        this.props.dispatch(updateEstablishment(data, this.state.establishmentPhotos));
        this.props.cancelModal();

    };


    isSIREN(cin) {
        if (cin.length > 0) return /^[0-9]\d{8}$/.test(cin);
        else return true;
      }
      isSIRET(cin) {
        if (cin.length > 0) return /^[0-9]\d{13}$/.test(cin);
        else return true;
      }

    render() {
        return (
            <Auxiliary>

                <Modal isOpen={this.props.modal} >
                    <ModalHeader toggle={this.handleCancel} className="modal-box-header bg-primary text-white">{<IntlMessages id="pages.establishementPage" />}</ModalHeader>
                    <ModalBody>
                        <form className="row" noValidate autoComplete="off" onSubmit={this.handleSubmit}>
                            <div className="col-sm-12">
                                <h1>{<IntlMessages id="component.etablishments.info.general" />}</h1>
                            </div>
                            <div className="col-sm-2">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="countries_id"
                                    name="countries_id"
                                    onChange={this.handleChange('countries_id')}
                                    select
                                    label={<IntlMessages id="components.establishments.formadd.country" />}
                                    value={this.state.countries_id || ''}
                                    SelectProps={{}}
                                    margin="normal"
                                    fullWidth
                                >
                                    {this.props.countries.map(option => (
                                        <MenuItem key={option.id} value={option.id}>
                                            {option.name}
                                        </MenuItem>
                                    ))}
                                </TextField>
                            </div>
                            <div className="col-sm-5">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="name"
                                    name="name"
                                    label={<IntlMessages id="components.establishments.formadd.name" />}
                                    onChange={this.handleChange('name')}
                                    value={this.state.name || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-5">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="ar_name"
                                    name="ar_name"
                                    label={<IntlMessages id="components.establishments.formadd.ar_name" />}
                                    disabled={this.state.ar_disabled}
                                    onChange={this.handleChange('ar_name')}
                                    value={this.state.ar_name || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="address"
                                    name="address"
                                    label={<IntlMessages id="components.establishments.formadd.adress" />}
                                    onChange={this.handleChange('address')}
                                    value={this.state.address || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="code"
                                    name="code"
                                    type="number"
                                    label={<IntlMessages id="components.establishments.formadd.codezip" />}
                                    onChange={this.handleChange('code')}
                                    value={this.state.code || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-4">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="city"
                                    name="city"
                                    label={<IntlMessages id="components.establishments.formadd.city" />}
                                    onChange={this.handleChange('city')}
                                    value={this.state.city || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-4">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="phone"
                                    name="phone"
                                    label={<IntlMessages id="components.establishments.formadd.phone" />}
                                    onChange={this.handleChange('phone')}
                                    value={this.state.phone || ''}
                                    type="number"
                                    margin="normal"
                                    fullWidth
                                />

                            </div>
                            <div className="col-sm-12">
                  <h1>{<IntlMessages id="etablishments.info.juri" />}</h1>
                </div>
{




this.state.countries_id ===1 ?  <div className="row col-sm-12">
                <div className="col-sm-4">
                  <TextField
                    required
                    variant="outlined"
                    id="matricule"
                    onChange={this.handleChange('matricule')}
                    value={this.state.matricule}
                    label={<IntlMessages id="etablishments.info.matricule" />}
                    margin="normal"
                    fullWidth
                  />
                </div>
                <div className="col-sm-4">
                  <TextField
                    required
                    variant="outlined"
                    id="tva"
                    onChange={this.handleChange('tva')}
                    value={this.state.tva}
                    label={<IntlMessages id="etablishments.info.tva" />}
                    margin="normal"
                    fullWidth
                    error={parseInt(this.state.tva, 10)< 0 ||  parseInt(this.state.tva, 10)>100}

                  />
                </div>
                <div className="col-sm-4">
                  <TextField
                    required
                    variant="outlined"
                    id="capital"
                    onChange={this.handleChange('capital')}
                    value={this.state.capital}
                    label={<IntlMessages id="etablishments.info.Capital" />}
                    margin="normal"
                    fullWidth
                    error={parseInt(this.state.capital, 10)< 0}

                  />
                </div>

                </div> :


<div className="row col-sm-12">
<div className="col-sm-3">
  <TextField
    required
    variant="outlined"
    id="siren"
    onChange={this.handleChange('siren')}
    value={this.state.siren}
    label={<IntlMessages id="etablishments.info.siren" />}
    margin="normal"
    fullWidth
    error={this.isSIREN(this.state.siren) === false ? true : false}

  />
</div>
<div className="col-sm-3">
  <TextField
    required
    variant="outlined"
    id="siret"
    onChange={this.handleChange('siret')}
    value={this.state.siret}
    label={<IntlMessages id="etablishments.info.siret" />}
    margin="normal"
    fullWidth
    error={this.isSIRET(this.state.siret) === false ? true : false}

  />
</div>
<div className="col-sm-3">
  <TextField
    required
    variant="outlined"
    id="tva"
    onChange={this.handleChange('tva')}
    value={this.state.tva}
    label={<IntlMessages id="etablishments.info.tva" />}
    margin="normal"
    fullWidth
    error={parseInt(this.state.tva, 10)< 0 ||  parseInt(this.state.tva, 10)>100}

  />
</div>
<div className="col-sm-3">
  <TextField
    required
    variant="outlined"
    id="capital"
    onChange={this.handleChange('capital')}
    value={this.state.capital}
    label={<IntlMessages id="etablishments.info.Capital" />}
    margin="normal"
    fullWidth
  />
</div>
</div>

}
                            <div className="col-sm-4">
                                <TextField
                                    id="email_establishment"
                                    name="email_establishment"
                                    variant="outlined"
                                    type="email"
                                    label={<IntlMessages id="components.establishments.formadd.email_establishment" />}
                                    onChange={this.handleChange('email')}
                                    value={this.state.email_establishment || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-4">
                                <TextField
                                    id="website"
                                    variant="outlined"
                                    name="website"
                                    label={<IntlMessages id="components.establishments.formadd.website" />}
                                    onChange={this.handleChange('website')}
                                    value={this.state.website || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-12">
                                <br /><br />
                                <h1>{<IntlMessages id="component.etablishments.info.director" />}</h1>
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="surname_director"
                                    name="surname_director"
                                    label={<IntlMessages id="components.establishments.formadd.surname_director" />}
                                    onChange={this.handleChange('surname_director')}
                                    value={this.state.surname_director || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="name_director"
                                    name="name_director"
                                    label={<IntlMessages id="components.establishments.formadd.name_director" />}
                                    onChange={this.handleChange('name_director')}
                                    value={this.state.name_director || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                variant="outlined"
                                    id="email_director"
                                    name="email_director"
                                    type="email"
                                    label={<IntlMessages id="components.establishments.formadd.email_director" />}
                                    onChange={this.handleChange('email_director')}
                                    value={this.state.email_director || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="phone_director"
                                    name="phone_director"
                                    label={<IntlMessages id="components.establishments.formadd.phone_director" />}
                                    onChange={this.handleChange('phone_director')}
                                    value={this.state.phone_director  || ''}
                                    type="number"
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-12">
                                <br /><br />
                                <h1>{<IntlMessages id="component.etablishments.info.licence" />}</h1>
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="estab_type_id"
                                    name="estab_type_id"
                                    select
                                    label={<IntlMessages id="components.establishments.formadd.Categories" />}
                                    value={this.state.estab_type_id  || ''}
                                    onChange={this.handleChange('estab_type_id')}
                                    SelectProps={{}}
                                    margin="normal"
                                    fullWidth
                                >
                                    {this.props.estabTypes.map(option => (
                                        <MenuItem key={option.id} value={option.id}>
                                            {option.name}
                                        </MenuItem>
                                    ))}
                                </TextField>
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    id="number_students"
                                    variant="outlined"
                                    name="number_students"
                                    label={<IntlMessages id="components.establishments.formadd.number_students" />}
                                    onChange={this.handleChange('number_students')}
                                    value={this.state.number_students || ''}
                                    type="number"
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="contract_start_date"
                                    name="contract_start_date"
                                    type="date"
                                    helperText={<IntlMessages id="components.establishments.formadd.contract_start_date" />}
                                    onChange={this.handleChange('contract_start_date')}
                                    value={this.state.contract_start_date || ''}
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="contract_end_date"
                                    name="contract_end_date"
                                    type="date"
                                    margin="normal"
                                    helperText={<IntlMessages id="components.establishments.formadd.contract_end_date" />}
                                    onChange={this.handleChange('contract_end_date')}
                                    value={this.state.contract_end_date || ''}
                                    fullWidth
                                />
                            </div>
                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="number_sms"
                                    name="number_sms"
                                    label={<IntlMessages id="components.establishments.formadd.number_sms" />}
                                    onChange={this.handleChange('number_sms')}
                                    value={this.state.number_sms || ''}
                                    type="number"
                                    margin="normal"
                                    fullWidth
                                />
                            </div>

                            <div className="col-sm-6">
                                <TextField
                                    required
                                    variant="outlined"
                                    id="mode_payment"
                                    name="mode_payment"
                                    select
                                    label={<IntlMessages id="components.establishments.formadd.mode_payment" />}
                                    value={this.state.mode_payment || ''}
                                    onChange={this.handleChange('mode_payment')}
                                    SelectProps={{}}
                                    margin="normal"
                                    fullWidth
                                >
                                    {mode_payment.map(option => (
                                        <MenuItem key={option.id} value={option.value}>
                                            {option.label}
                                        </MenuItem>
                                    ))}
                                </TextField>
                            </div>
                            <div className="col-sm-12">
                                <br /><br />
                                <h1>{<IntlMessages id="sidebar.modules" />}</h1>
                            </div>
                            <div className="col-sm-6">
                                <FormControl className="w-100">
                                    <InputLabel htmlFor="name-multiple">{<IntlMessages id="sidebar.modules" />}</InputLabel>
                                    <Select
                                        multiple
                                        name="modules"
                                        value={this.state.modules || ''}
                                        onChange={this.handleChangeModule}
                                        input={<Input id="name-multiple" />}
                                        MenuProps={{
                                            PaperProps: {
                                                style: {
                                                    maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
                                                    width: 200,
                                                },
                                            },
                                        }}
                                    >
                                        {
                                            this.props.moduleList.map((moduleEstablishment, index) => (
                                                <MenuItem
                                                key={Math.random()}
                                                    value={moduleEstablishment.id}
                                                >
                                                    {moduleEstablishment.name}
                                                </MenuItem>
                                            ))}
                                    </Select>
                                </FormControl>
                            </div>
                            <div className="col-sm-6">
                                <div className="manage-margin d-flex flex-wrap">

                                    {this.state.modules.map(data => {
                                        return (
                                            <Chip
                                                avatar={<Avatar
                                                    src={require('../../../../../assets/images/module.jpg')} />}
                                                label={this.props.moduleList.map(moduleEstablishment => {
                                                    if (moduleEstablishment.id === data) {
                                                        return (
                                                            moduleEstablishment.name
                                                        );
                                                    } else { return null }
                                                })}
                                                key={data.id}
                                            />
                                        );
                                    })}
                                </div>
                            </div>
                            <div className="col-sm-12 pt-3">

                                <InputLabel htmlFor="name-multiple">{<IntlMessages id="components.establishments.formadd.logo" />}</InputLabel> <br /> <br />
                                <label htmlFor="files" className="btn" style={{ cursor: "pointer", color: "white", fontWeight: "bold", backgroundColor: '#4C19A9', borderRadius: '4rem' }} ><strong>{<IntlMessages id="components.establishments.formadd.selectImage" />}</strong></label> <label htmlFor="files" className="btn">{this.state.inputText}</label>
                                <input id="files" type="file" style={{ visibility: "hidden" }} onChange={(e) => this.onDrop(e)} />


                            </div>
                            <div className="col-md-6 text-left ">
                                <br /><br />
                                <Button variant="contained" className="jr-btn bg-indigo text-white " type="submit" >{<IntlMessages id="components.establishments.formModify.buttonModify" />}</Button>
                                <Button variant="contained" className="jr-btn bg-grey text-white " onClick={this.handleCancel}>{<IntlMessages id="components.establishments.formadd.buttonCancel" />}</Button>
                            </div>
                            <div className="col-md-6 text-right ">
                                <br /><br />
                                <Button className="jr-btn bg-indigo text-white" color="secondary" onClick={this.handleDelete} >{<IntlMessages id="button.delete" />}</Button>
                            </div>
                        </form>
                    </ModalBody>
                </Modal>
            </Auxiliary>

        )
    }

}

export default connect()(EditEstablishment);
